import "./header.css"

export default function Header() {
  return (
    <div className="header">
      <div className="judulHeader">
        <span className="Header1">React & Node</span>
        <span className="Header2">Blog</span>
      </div>
      <img className="gambar" src="https://i.pinimg.com/originals/89/dc/10/89dc10a10c2018972f68fe1ad14f7b7c.jpg"/>
    </div>
  )
}
